import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { Card, Button, } from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <header className='App-header'>

        <Card className='mb-3' style={{ color: "#000" }}>
          <Card.Img src='https://picsum.photos/seed/picsum/200/300'/>
          <Card.Body>
            <Card.Title></Card.Title>


          </Card.Body>

        </Card>
        <Button>Did this work?????</Button>



      </header>
    </div>
  );
}

export default App;
